import s from './Nav.module.css'
import {NavLink} from "react-router-dom";

const Navbar = () => {
    return <nav className={s.nav}>
        <div><NavLink className={s.item} href='/profile'>Profile</NavLink></div>
        <div><NavLink className={s.item} href='/messages'>Messages</NavLink></div>
        <div><NavLink className={s.item} href='/news'>News</NavLink></div>
        <div><NavLink className={s.item} href='/music'>Music</NavLink></div>
        <br/>
        <div><a className={s.item} href='/setting'>Setting</a></div>
    </nav>
}

export default Navbar;
